export default function PostForm({ user, dispatchUser }) {
  return (
    <Card className="d-flex ">
      <Card.Header>
        <Card.Img src={user.data.avatarsrc}></Card.Img>
      </Card.Header>
      <Card.Body>
        <Form>
          <Form.Control as="textarea"></Form.Control>
        </Form>
      </Card.Body>
    </Card>
  );
}
